import * as t from "./types";

export function buttonReducer(action) {
    console.log(action)
    if(action==undefined){
        action={
            type:t.DID
        }
    }
  switch (action.type) {
    case t.DID:{
        console.log("did");
      }
      break;
    case t.CANCELED:{
        console.log("canceled");
      }
      break;
    case t.CLOSED:{
        console.log("closed");
      }
      break;
    default:
      return;
  }
}
